import React from "react";
import { ButtonData, UserData } from "../../types/Models";
import './Navbar.css'

interface NavbarData {
    buttonData: ButtonData[];
    userData: UserData;
}

interface ElementData {
    element: ButtonData
}

interface LoggedInUser {
    userData: UserData
}

const Navbar: React.FC<NavbarData> = ({buttonData, userData}) => {
    return (
        <>
        <ul className="navbar">
            {
                buttonData.map(element => (
                    <NavbarElement element={element} />
                ))
            }
            <TweetButton />
        </ul>

        </>
    )
}

const NavbarElement: React.FC<ElementData> = ({element}) => {
    return (
        <>
        <li className="navbar-element">
            <img className="invert-logo" src={element.icon?.url} width={element.icon?.aspX} height={element.icon?.aspY}/>
            <h4><a href="/">{element.buttonText}</a></h4>
        </li>
        </>
    )
}

const TweetButton: React.FC = () => {
    return (
        <button className="tweet-btn">
            Tweet
        </button>
    )
}

const LoggedInCard: React.FC<LoggedInUser> = ({userData}) =>{
    return (
        <div className="logged-in-car">
            <img src={userData.imageData.url} width={userData.imageData.aspX} height={userData.imageData.aspY} />
        </div>
    )
}

export default Navbar;
